import React from 'react';
import s from './styles/Upload.module.css';

const Upload = () => {
  return (
    <div className={s.container}>
      <div className={s.wrapper}>
        <input type="file" alt="loading" className={s.input} />
        <button type="submit" />
      </div>
    </div>
  );
};

export default Upload;
